export abstract class PieceModel{
    protected type:string;
    protected color:string;

    public constructor(type: string, color: string){
        this.type = "white"|"black"? type:"error";
        this.color = color;
    }

    public getType(): string{
        return this.type;
    }
    public getColor(): string{
        return this.color;
    }
}
